InventOwnerId_RU callerInventOwnerId()
{
    FieldId     inventOwnerFieldId;
    Common      common;
    inventOwnerFieldId = inventDimFormSetup.callerInventOwnerFieldId_RU();

    if (! inventOwnerFieldId)
        return '';

    common = inventDimFormSetup.callerInventOwnerIdCursor_RU();
    if (common.TableId == tableNum(Common))
        return '';

    return common.(inventOwnerFieldId);
}

void close()
{
    xSysLastValue::saveLast(this);

    super();
}

void init()
{
    InventOwnerId_RU  inventOwnerId;

    super();

    this.initReturnMode();

    FormStringControl callerControl   = SysTableLookup::getCallerStringControl(element.args());

    element.updateDesign(InventDimFormDesignUpdate::Init);

    inventDimFormSetup.initInventDimQueryDatasource(inventDim_ds);
    inventDimFormSetup.initInventSumQueryDatasource(inventSum_ds);

    xSysLastValue::getLast(this);

    if (inventDimFormSetup.hasCallerInventDimParm())
        ctrlLinkDim.value(linkDim);
    else
    {
        linkDim = false;
        ctrlLinkDim.visible(false);
    }

    Common recordToPosition;

    if (callerControl && callerControl.text() && !callerControl.hasChanged())
    {
        inventOwnerId = element.callerInventOwnerId();
        if (inventOwnerId)
        {
            recordToPosition = InventOwner_RU::find(inventOwnerId);
        }
    }

    Map lookupTabCollection = new Map(Types::Integer, Types::Class);

    lookupTabCollection.insert(1, new InventDimensionWithOnHandLookupTab(1, inventOwner_InventOwnerId, inventOwner_ds));
    lookupTabCollection.insert(2, new InventDimensionWithOnHandLookupTab(2, inventoryDimensions_InventOwnerId_RU, inventDim_ds));
    lookupTabCollection.insert(3, new InventDimensionWithOnHandLookupTab(3, inventDimTrans_inventOwnerId_RU, inventDimTrans_ds));

    inventDimensionWithOnHandLookup = InventDimensionWithOnHandLookup::newWithTabCollection(callerControl,
        ctrlTab,
        lookupTabCollection,
        recordToPosition
        );

    inventAvailabilityFormCache = InventAvailabilityFormCache::construct();
}

void initParmDefault()
{
    showAvail = true;
}

private void initReturnMode()
{
    SalesLine           returnLine;

    if (element.args() && element.args().dataset() == tableNum(InventDim))
    {
        returnLine = InventLookupReturn::initSalesReturnMode(element.args().record());

        if (returnLine.InventTransIdReturn)
        {
            returnMode = true;
            tabPageOwner.visible(false);
            tabPageOnHand.visible(false);
            ctrlTab.showTabs(false);

            inventTrans_ds.query().dataSourceTable(tableNum(InventTrans)).clearDynalinks();
            inventTrans_ds.query().dataSourceTable(tableNum(InventTransOrigin)).addRange(fieldNum(InventTransOrigin,InventTransId)).value(queryValue(returnLine.InventTransIdReturn));
            inventTrans_ds.query().dataSourceTable(tableNum(InventTrans)).addRange(fieldNum(InventTrans, InvoiceId)).value(SysQuery::valueNotEmptyString());
        }
    }
}

