void run()
{
    this.setSelectMode();

    boolean filterLookup = inventDimensionWithOnHandLookup.filterLookupPreRun();

    this.setShowAvail();

    super();

    inventDimensionWithOnHandLookup.filterLookupPostRun(filterLookup);

    if (returnMode)
    {
        ctrlTab.tab(3);
        ctrlTab.tabChanged(0, 3);
    }
}

private void setSelectMode()
{
    inventDimensionWithOnHandLookup.setSelectMode();
    this.selectMode(inventDimensionWithOnHandLookup.getSelectedControl());
}

void setShowAvail()
{
    ctrlInventSum_AvailOrdered.visible(ctrlShowAvail.value());
    ctrlInventSum_AvailPhysical.visible(ctrlShowAvail.value());
    ctrlPhysicalInvent.visible(!ctrlShowAvail.value());
}

public boolean unpack(container packedClass)
{
    Integer     tmpVersion     = conPeek(packedClass,1);
    Integer     tab;

    switch (tmpVersion)
    {
        case #CurrentVersion :
            [tmpVersion,#CurrentList,tab] = packedClass;
            break;
        default :
            return false;
    }

    if (!showItemInfo && tab == 2)
    {
        ctrlTab.tab(1);
    }
    else
    {
        ctrlTab.tab(tab);
    }

    return true;
}

void updateDesign(InventDimFormDesignUpdate   mode)
{
    showItemInfo = true;
    switch (mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (! inventDimFormSetup)
            {
                if (element.args().dataset() == tableNum(TmpSysQuery))
                {
                    inventDimFormSetup  = InventDimCtrl_Frm_Lookup_TmpSysQuery::newFromFormSortField(element,fieldNum(InventDim, InventOwnerId_RU));
                }
                else
                {
                    inventDimFormSetup  = InventDimCtrl_Frm_Lookup::newFromFormSortField(element,fieldNum(InventDim, InventOwnerId_RU));
                }
            }
            if (! inventDimFormSetup.hasCallerItemId())
            {
                showItemInfo = false;
                tabPageOnHand.visible(false);
                ctrlTab.showTabs(false);
                ctrlGroupSetup.visible(false);
            }
            break;
        case InventDimFormDesignUpdate::LinkActive:
            inventDimFormSetup.formActiveSetup();
            inventDimFormSetup.formSetControls(true,true);
            break;
        default:
            throw error(strFmt("@SYS54195",funcName()));
    }
}

void executeQuery()
{
    QueryBuildDataSource    qbds = this.query().dataSourceName(this.name());
    DictRelation            dr;
    Counter                 i;
    FormStringControl       ctrl;
    FormDataSource          callerFormDatasource;
    DictType                dt;
    ExtendedTypeId          extendedTypeId;

    qbds.clearDynalinks();

    ctrl = element.selectTarget() as FormStringControl;
    if (ctrl)
    {
        extendedTypeId = ctrl.extendedDataType();
        if (extendedTypeId)
        {
            dt = new DictType(extendedTypeId);
            dr = dt.relationObject();
        }
        else
        {
            callerFormDatasource = inventDimFormSetup.callerFormDatasource();
            if (callerFormDatasource)
            {
                dr = new DictRelation(callerFormDatasource.table());
                dr.loadFieldRelation(ctrl.dataField());
            }
        }
    }
    if (dr)
    {
        for (i=1;i<=dr.lines();i++)
        {
            switch (dr.lineType(i))
            {
                case TableRelation::ExternFixed:
                    qbds.addRange(dr.lineExternTableValue(i)).value(queryValue(dr.lineTableValue(i)));
                    break;
            }
        }
    }

    super();
}

void init()
{
    Query                   q;
    QueryBuildDataSource    qbds;

    super();

    q = new Query();
    qbds = q.addDataSource(tableNum(InventOwner_RU));
    qbds.name(this.name());
    qbds.addSortField(fieldNum(InventOwner_RU, InventOwnerId));

    this.query(q);
}

/// <summary>
///    Display the physically available inventory.
/// </summary>
/// <param name="_inventDim">
///    The current <c>InventDim</c> table record.
/// </param>
/// <returns>
///    The physically available quantity.
/// </returns>
public display InventQtyAvailPhysical availPhysical(InventDim _inventDim)
{
    return inventAvailabilityFormCache.availabilityFromDimJoinedWithSum(_inventDim, inventSum_ds).availPhysical();
}

/// <summary>
///    Display the total available inventory.
/// </summary>
/// <param name="_inventDim">
///    The current <c>InventDim</c> table record.
/// </param>
/// <returns>
///    The total available quantity.
/// </returns>
public display InventQtyAvailOrdered availOrdered(InventDim _inventDim)
{
    return inventAvailabilityFormCache.availabilityFromDimJoinedWithSum(_inventDim, inventSum_ds).availTotal();
}

void init()
{
    Query                   q;
    QueryBuildDataSource    qbds;

