}

void executeQuery()
{
    QueryBuildDataSource qbds;
    if (inventDimFormSetup.hasCallerItemId())
    {
        inventDimFormSetup.executeInventDimQueryDatasource(this,
                                                           linkDim,
                                                           showAvail
                                                          );

        element.updateDesign(InventDimFormDesignUpdate::LinkActive);

        if (this.queryRun())
        {
            qbds = this.queryRun().query().dataSourceName(this.name());
        }
        else
        {
            qbds = this.query().dataSourceName(this.name());
        }

        inventAvailabilityFormCache.refreshCache();

        super();
    }
}

void executeQuery()
{
    #DEFINE.QueryNoLitterals(2)

    QueryBuildDataSource    qbsTrans;
    QueryBuildDataSource    qbsDim;

    if (returnMode)
    {
        super();
        return;
    }

    this.query().literals(#QueryNoLitterals);

    qbsTrans = this.query().dataSourceTable(tableNum(InventTrans));
    qbsDim   = this.query().dataSourceTable(tableNum(InventDim));

    qbsTrans.sortClear();
    qbsDim.sortClear();

    if (inventDim.InventOwnerId_RU)
    {
        InventDim::queryAddRangeFromDSSort(inventTrans_ds.query().dataSourceTable(tableNum(InventDim)),inventDim_DS);

        rangeRecId.value(SysQuery::valueUnlimited());

        qbsTrans.addSortIndex(indexNum(InventTrans, DimIdIdx));
        qbsTrans.indexIsHint(true);

        qbsDim.addSortIndex(indexNum(InventDim, InventOwnerIdx_RU));
        qbsDim.indexIsHint(true);
    }
    else
    {
        rangeRecId.value(queryValue(-1));

        this.query().literals(#QueryNoLitterals);

        qbsTrans.addSortIndex(indexNum(InventTrans, recId));
        qbsTrans.indexIsHint(true);

        qbsDim.addSortIndex(indexNum(InventDim, DimIdIdx));
        qbsDim.indexIsHint(true);
    }

    super();
}

void init()
{
    super();

    rangeRecId = this.query().dataSourceTable(tableNum(InventTrans)).addRange(fieldNum(InventTrans, RecId));
}

public void tabChanged(int _fromTab, int _toTab)
{
    super(_fromTab, _toTab);

    mustSaveLast = true;

    element.setSelectMode();

    if (_toTab == 3)
    {
        if (inventDimFormSetup.hasCallerItemId())
        {
            element.selectMode(inventDimTrans_InventOwnerId_RU);
            inventDimTrans_InventOwnerId_RU.setFocus();
        }
        else
        {
            element.selectMode(inventOwner_InventOwnerId);
            inventOwner_InventOwnerId.setFocus();
        }

        inventDim_ds.executeQuery();
        inventTrans_ds.executeQuery();
    }
    else
    {
        element.lookupTabChanged();
    }
}

void clicked()
{
    super();

    showAvail = ! showAvail;

    inventDim_ds.executeQuery();

    element.setShowAvail();
}

void clicked()
{
    super();

    linkDim = ! linkDim;

    inventDim_ds.executeQuery();
}
